import React from 'react';

function StudentList({ students }) {
  return (
    <div>
      <h2>Student List</h2>
      <ul>
        {students.map(s => (
          <li key={s.id}>{s.name} - {s.email} - {s.course}</li>
        ))}
      </ul>
    </div>
  );
}

export default StudentList;
